import React from 'react';
import { useNavigate } from 'react-router-dom'; // Asegúrate de importar useNavigate correctamente
import './Registro.css'; // Usamos un archivo CSS específico para el registro
import logo from '../assets/logo.png'; // Importamos el logo

function Registro() {
  const navigate = useNavigate(); // Asegúrate de definir el navigate aquí

  const handleRegister = () => {
    navigate('/home'); // Redirige al usuario a /home después de registrarse
  };

  const handleLogin = () => {
    navigate('/home'); // Redirige al usuario a /home al hacer clic en "Ya tengo cuenta"
  };

  return (
    <div className="home-container">
      <img src={logo} alt="Logo" className="logo" /> {/* Aquí cargamos el logo PNG */}
      <div className="content">
        <h2>GALICHESS FANTASY</h2>
        <button className="create-account-btn" onClick={handleRegister}>Crear Cuenta</button>
        <button className="login-btn" onClick={handleLogin}>Ya tengo cuenta</button> {/* Botón corregido */}
      </div>
    </div>
  );
}

export default Registro;
